import React from "react";

const CustomerItem = (props) => {

    const {customer} = props

    return (
        <div>
            <b>{customer.name}</b>
            <p>{customer.email}</p>
            <p>{customer.mobile}</p>
            <p>Customer Since - {customer.createdAt}</p>
            <button>Delete</button>

        </div>
    )
}

export default CustomerItem
